import React from "react"

class Example extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      count: 0
    }
  }



  render() {
    const {count} = this.state
    return (
      <div onClick={()=>this.onCount}>
        {count}
      </div>
    )
  }
}

export default Example
